INSERT INTO `config_info` VALUES (6, 'gateway-dev.yaml', 'aigpt-plus-project', 'server:\n  port: 63090\nspring:\n  data:\n    redis:\n      host: 192.168.101.132\n      port: 6379\n      password: redis\n      database: 1\n      timeout: 100000\n      lettuce:\n        pool:\n          max-active: 16\n          max-idle: 8\n          max-wait: -1\n          min-idle: 1\n  cloud:\n    gateway:\n      discovery:\n        locator:\n          # enabled: true\n          lowerCaseServiceId: true\n      globalcors:\n        # 允许的跨域来源\n        cors-configurations:\n          \'[/**]\':  # 表示匹配所有路由\n            allowedOrigins: \"http://localhost:8000, http://localhost:8001, http://localhost:3000\"  # 允许的跨域请求来源\n            allowedMethods:\n              - GET\n              - POST\n              - PUT\n              - DELETE\n            allowedHeaders:\n              - \"*\"\n            allowCredentials: true  # 是否允许发送 cookie 信息\n            maxAge: 3600  # 预检请求的缓存时间，单位秒\n      routes:\n        # - id: content-api\n        #   uri: lb://content-api\n        #   predicates:\n        #     - Path=/content/**\n          # filters:\n          #   - SwaggerHeaderFilter\n        - id: auth\n          uri: lb://auth\n          predicates:\n            - Path=/auth/**\n          # filters:\n          #   - SwaggerHeaderFilter\n        - id: checkcode\n          uri: lb://checkcode\n          predicates:\n            - Path=/checkcode/**\n          # filters:\n          #   - SwaggerHeaderFilter\n        - id: chart\n          uri: lb://chart\n          predicates:\n            - Path=/chart/**\n          # filters:\n          #   - SwaggerHeaderFilter\n        - id: media-api\n          uri: lb://media-api\n          predicates:\n            - Path=/media/**\n        - id: course-api\n          uri: lb://course-api\n          predicates:\n            - Path=/course/**\n        - id: practice-api\n          uri: lb://practice-api\n          predicates:\n            - Path=/practice/**\n        - id: dictionary\n          uri: lb://dictionary\n          predicates:\n            - Path=/dictionary/**\n        - id: order-api\n          uri: lb://order-api\n          predicates:\n            - Path=/order/**\n        - id: permission\n          uri: lb://permission\n          predicates:\n            - Path=/permission/**\n  datasource:\n    driver-class-name: com.mysql.cj.jdbc.Driver\n    url: jdbc:mysql://192.168.101.132:3306/aigpt\n    username: root\n    password: root\napplication:\n  security:\n    jwt:\n      secret-key: 404E635266556A586E3272357538782F413F4428472B4B6250645367566B5970\n      expiration: 86400000\n      refresh-token:\n        expiration: 604800000\n\nlogging:\n  level:\n    org.springframework:\n      cloud.gateway: debug', 'fabd076fd59b40b85541e8b918966f5a', '2024-09-23 14:43:06', '2024-12-02 07:50:01', NULL, '192.168.101.1', '', 'devAI_plus', '', '', '', 'yaml', '', '');
